import axiosClient from './axiosClient';

const companyListAPI = {
    getAll: () =>{
        const url = 'Companies/getall';
        return axiosClient.get(url);
    },

    getById: (id) =>{
        const url = '/page';
        return axiosClient.get(url, {id});
    },
}

export default companyListAPI;
